import styled from '@emotion/styled';

function EmotionComponent() {
  return (
    <Box>
      <how>이모션을 활용한 컴포넌트</how>
      <p>이모션 컴포넌트입니다</p>
    </Box>
  );
}

let Box = styled.div`
  background-color: silver;
  width: 100%;
`;


let how = styled.h1`
    background-color: antiquewhite;
    margin: 0px auto;
`



export default EmotionComponent;
